import React, { useState } from "react";
import CSVImporter from "./CSVImporter";

const API_KEY = "3BDQHX4LUKMMEP3GSUWSE5WIEDLZR3QG";
const BASE_URL = "https://besancon-archerie.fr/boutique/api";

function parseXMLToObject(xmlString) {
  const parser = new DOMParser();
  const xml = parser.parseFromString(xmlString, 'application/xml');
  const product = xml.querySelector('product');
  if (!product) return null;

  const id = product.querySelector('id')?.textContent;
  const wholesale_price = parseFloat(product.querySelector('wholesale_price')?.textContent || '0');
  const price = parseFloat(product.querySelector('price')?.textContent || '0');
  const quantity = parseInt(product.querySelector('quantity')?.textContent || '0');

  return { id, wholesale_price, price, quantity };
}

async function fetchProductData(reference) {
  const headers = {
    'Authorization': 'Basic ' + btoa(API_KEY + ':'),
    'Accept': 'application/xml'
  };

  const url = `${BASE_URL}/products/?filter%5Breference%5D=${encodeURIComponent(reference)}&display=full`;
  const res = await fetch(url, { headers });
  const text = await res.text();
  const product = parseXMLToObject(text);
  return product;
}

export default function CommandeView() {
  const [produits, setProduits] = useState([]);

  const enrichWithAPI = async (data) => {
    const enriched = await Promise.all(
      data.map(async (item) => {
        const apiData = await fetchProductData(item.reference);
        return {
          ...item,
          stock: apiData?.quantity ?? '❌',
          prixAchatPresta: apiData?.wholesale_price ?? '❌',
          prixVenteTTC: apiData?.price ?? '❌',
          marge: apiData ? (apiData.price - apiData.wholesale_price).toFixed(2) : '❌',
        };
      })
    );
    setProduits(enriched);
  };

  return (
    <div className="p-6 max-w-7xl mx-auto">
      <h1 className="text-3xl font-bold mb-6">Commande Produits</h1>
      <CSVImporter onDataLoaded={enrichWithAPI} />
      <div className="overflow-x-auto">
        <table className="min-w-full bg-white border border-gray-300 rounded-lg">
          <thead className="bg-gray-100">
            <tr>
              <th className="px-4 py-2 text-left">Référence</th>
              <th className="px-4 py-2 text-left">Nom du produit</th>
              <th className="px-4 py-2 text-left">Marque</th>
              <th className="px-4 py-2 text-left">Prix (CSV)</th>
              <th className="px-4 py-2 text-left">Quantité</th>
              <th className="px-4 py-2 text-left">Stock</th>
              <th className="px-4 py-2 text-left">Prix achat Presta</th>
              <th className="px-4 py-2 text-left">Prix vente TTC</th>
              <th className="px-4 py-2 text-left">Marge brute (€)</th>
            </tr>
          </thead>
          <tbody>
            {produits.map((prod, idx) => (
              <tr key={idx} className="border-t">
                <td className="px-4 py-2">{prod.reference}</td>
                <td className="px-4 py-2">{prod.titre}</td>
                <td className="px-4 py-2">{prod.brand}</td>
                <td className="px-4 py-2">{prod.prix.toFixed(2)}</td>
                <td className="px-4 py-2">{prod.quantite}</td>
                <td className="px-4 py-2">{prod.stock}</td>
                <td className="px-4 py-2">{typeof prod.prixAchatPresta === 'number' ? prod.prixAchatPresta.toFixed(2) : prod.prixAchatPresta}</td>
                <td className="px-4 py-2">{typeof prod.prixVenteTTC === 'number' ? prod.prixVenteTTC.toFixed(2) : prod.prixVenteTTC}</td>
                <td className="px-4 py-2">{prod.marge}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
